INSERT INTO `program` VALUES (38,38,'Walking Dead','Sheriff Deputy Rick Grimes wakes up from a coma to learn the world is in ruins, and must lead a group of survivors to stay alive.','https://lorempixel.com/640/480/?91900','walking-dead'),(39,38,'The Haunting Of Hill House','Flashing between past and present, a fractured family confronts haunting memories of their old home and the terrifying events that drove them from it.','https://lorempixel.com/640/480/?58602','the-haunting-of-hill-house'),(40,39,'American Horror Story','An anthology series centering on different characters and locations, including a house with a murderous past, an insane asylum, a witch coven, a freak show circus, a haunted hotel, a possessed farmhouse, a cult, the apocalypse, and a slasher summer camp.','https://lorempixel.com/640/480/?40592','american-horror-story'),(41,40,'Love Death And Robots','A collection of animated short stories that span various genres including science fiction, fantasy, horror and comedy.','https://lorempixel.com/640/480/?14934','love-death-and-robots'),(42,38,'Penny Dreadful','Explorer Sir Malcolm Murray, American gunslinger Ethan Chandler, scientist Victor Frankenstein, and medium Vanessa Ives unite to combat supernatural threats in Victorian London.','https://lorempixel.com/640/480/?45472','penny-dreadful'),(43,38,'Fear The Walking Dead','A Walking Dead spin-off, set in Los Angeles, following two families who must band together to survive the undead apocalypse.','https://lorempixel.com/640/480/?58981','fear-the-walking-dead'),(49,38,'teststst','test','test','test'),(50,36,'test','test','test','test'),(51,37,'test','test','test','test'),(52,37,'test','test','test','test'),(53,37,'walking not dead','walking not dead','walking not dead','walking-not-dead'),(54,36,'walking without head','walking without head','walking without head','walking-without-head'),(55,39,'Waldsdsdking Dead','plus belle la vie','sds','waldsdsdking-dead');
